class KeyStorageMode5:
    def __init__(self, unique_module_key="", default_network_key=""):
        self._unique_module_key = binascii.unhexlify(unique_module_key)
        self._default_network_key = binascii.unhexlify(default_network_key)

    def get_module_keys(self, address):
        return self._unique_module_key, self._default_network_key


class KeyStorage:
    def __init__(self, module_keys={}, default_network_key=""):
        self._keys = module_keys
        self._default_network_key = binascii.unhexlify(default_network_key)

    def get_module_keys(self, address):
        keys = self._keys.get(str(address))
        if keys is None:
            return None, None
        if type(keys) == list:
            decryption_keys = keys[0]
            network_key = binascii.unhexlify(keys[1])
        else:
            decryption_keys = keys
            network_key = self._default_network_key
        decryption_keys = decryption_keys.split(';')
        return [binascii.unhexlify(k[0:32]) for k in decryption_keys], network_key


